const sort = toSort => {
  const sorted = toSort;
  sorted.sort(function(a, b) {
    const nameA = a.sortBy ? a.sortBy.toLowerCase() : a.name.toLowerCase(),
      nameB = b.sortBy ? b.sortBy.toLowerCase() : b.name.toLowerCase();
    if (nameA < nameB) return -1;
    if (nameA > nameB) return 1;
    return 0;
  });
  return sorted;
};

